"data" : [
{
"name":"Stap 1: Aanvragen indicatie  Kees Schouten is 18 jaar geleden geboren met een licht verstandelijke beperking. Hij wordt vandaag (1 mei) 18 jaar. Hij is tot zijn 18e verjaardag in behandeling geweest vanuit de Jeugdwet en ontving zorg in een LVG behandelinstelling. De behandelaar geeft aan dat  hij nog voor het komende half jaar, van 1 mei tot 1 november,  wekelijks voortzetting van deze behandeling nodig acht in een LVG Behandelinstelling. Hiervoor is bij het CIZ een Wlz-indicatie aangevraagd. Kees geeft aan dat hij niet meer opgenomen wil worden.   Op 1 mei stuurt het CIZ het volgende indicatiebesluit naar het zorgkantoor.",
"type":"Bedrijfsfunctie"
}
]
