"name":"Stap 3: Aanvragen aangepaste zorgtoewijzing  De Kersentuin kan de zorg niet doelmatig leveren, reden daarvan is de beademing die Yvonne nodig heeft. Met behulp van de rekenmodule stelt de Kersentuin vast dat het budget voor ZZP 4LG voor de leveringsvorm MPT met  20% overschreden zal worden.   De Kersentuin vraagt op 12 april door middel van een AAT  een zorgtoewijzing aan voor 120%. Omdat de zorg niet doelmatig geleverd kan worden stuurt de zorgaanbieder de rekenmodule als onderbouwing op naar het zorgkantoor.  In de AW39 is geen Mutatie opgenomen; De Kersentuin kan  de zorg immers direct leveren. Het bericht bevat alleen een Aanvraag voor het verhogen van het toegewezen percentage.",
